/* Early career */I have amended the sentence in EARLY CAREER: (DELETED) Standard Chartered building in Kuala Lumpur, as this building is designed by Architect Hijjas Bin Kasturi , founder of Hijjas Kasturi Associate Sdn


(ORIGINAL)
His architectural designs (together with the other BEP partner C.H.R Bailey) include the Dewan Tunku Canselor at the Universiti Malaya, the Subang International Airport, and the Standard Chartered building in Kuala Lumpur.
